import React, { Component } from "react";
import PrettyHome from './homeStyles';
import Product from '../product/product';

class Home extends Component {
    render() {
        return (
            <div>
                <PrettyHome>
                    hello world this is the home page
                    <Link className='logo' to='/product/:auctionId' component={Product}>Thread Auction</Link>
                    <Link className='logo' to='/product' component={Product}>Thread Auction</Link>

                </PrettyHome>
            </div>

        )
    }
}

export default Home;
